import React, { useState } from "react";
import "../styles.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [isHovered1, setIsHovered1] = useState(false);
  const [isHovered2, setIsHovered2] = useState(false);
  const [isHovered3, setIsHovered3] = useState(false);
  const [isHovered4, setIsHovered4] = useState(false);
  const [isHovered5, setIsHovered5] = useState(false);
  // const [isHovered6, setIsHovered6] = useState(false);

  const handleMouseEnter1 = () => {
    setIsHovered1(true);
  };

  const handleMouseLeave1 = () => {
    setIsHovered1(false);
  };

  const handleMouseEnter2 = () => {
    setIsHovered2(true);
  };

  const handleMouseLeave2 = () => {
    setIsHovered2(false);
  };

  const handleMouseEnter3 = () => {
    setIsHovered3(true);
  };

  const handleMouseLeave3 = () => {
    setIsHovered3(false);
  };

  const handleMouseEnter4 = () => {
    setIsHovered4(true);
  };

  const handleMouseLeave4 = () => {
    setIsHovered4(false);
  };

  const handleMouseEnter5 = () => {
    setIsHovered5(true);
  };

  const handleMouseLeave5 = () => {
    setIsHovered5(false);
  };

  return (
    <>
      <section id="home">
        <nav class="navbar navbar-expand-lg bg-body-tertiary">
          <div class="container">
            <img
              src={process.env.PUBLIC_URL + "/images/logo.png"}
              alt="Logo"
              className="logo"
            />
            <Link class="navbar-brand text-primary" to="#home">
              Hotel <span></span>
            </Link>
            <button
              class="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarSupportedContent"
              aria-controls="navbarSupportedContent"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse" id="navbarSupportedContent">
              <ul class="navbar-nav mx-auto">
                <li class="nav-item">
                  <a
                    class="nav-link active text-white d-flex"
                    onMouseEnter={handleMouseEnter1}
                    onMouseLeave={handleMouseLeave1}
                    href="#intro"
                  >
                    <div>
                      <img
                        src={
                          isHovered1
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Home</div>
                  </a>
                </li>
                <li class="nav-item">
                  <a
                    class="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter2}
                    onMouseLeave={handleMouseLeave2}
                    href="#about"
                  >
                    <div>
                      <img
                        src={
                          isHovered2
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Room</div>
                  </a>
                </li>
                <li class="nav-item">
                  <a
                    class="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter3}
                    onMouseLeave={handleMouseLeave3}
                    href="#room"
                  >
                    <div>
                      <img
                        src={
                          isHovered3
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Services</div>
                  </a>
                </li>
                <li class="nav-item">
                  <Link
                    class="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter4}
                    onMouseLeave={handleMouseLeave4}
                    to="/book"
                  >
                    <div>
                      <img
                        src={
                          isHovered4
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Book</div>
                  </Link>
                </li>
                <li class="nav-item">
                  <Link
                    class="nav-link text-primary d-flex"
                    onMouseEnter={handleMouseEnter5}
                    onMouseLeave={handleMouseLeave5}
                    to="/login"
                  >
                    <div>
                      <img
                        src={
                          isHovered5
                            ? process.env.PUBLIC_URL + "/icons/home.gif"
                            : process.env.PUBLIC_URL + "/icons/home.png"
                        }
                        alt="Home Icon"
                        className="icon mt-0"
                      />
                    </div>
                    <div className="mt-1">Login</div>
                  </Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </section>
    </>
  );
};

export default Navbar;
